import React from "react";
import styled from "styled-components";
import eye from "./eye.png";
const Eyebtn = styled.img`
  font-weight: bold;
  width: 120px;
  height: 40px;
  border-radius: 4px;
  background: rgb(1, 134, 203);
  left: 2%;
  margin-top: 2%;
  transform: translate() (-50%, -5%);
  z-index: 20;
  box-shadow: rgba(60, 64, 67, 0.3) 0px 1px 2px 0px,
    rgba(60, 64, 67, 0.15) 0px 1px 3px 1px;
`;

function TheEyebtn() {
  return (
                    <Eyebtn>
                      <Eyetxt>
                        <Eyeimg src={eye} alt="eye" />
                        <div>App</div>
                      </Eyetxt>
                    </Eyebtn>
  );
}

export default  TheEyebtn;
